    <p>K S Rangasamy college of arts and Science</p>
    <p style={{color:'blue'}}>I am manojkumar,KSR student -2021 Passed out</p>
    <ul >KSR  INSTITUTIONS DETAILS
        <li>KSR for womens</li>
